  false,\n\t\"url\": null,\n\t\"notes\": \"The gravity station data (24,284 records)
  were compiled by the U. S. Geological Survey. This data base was received on February
  23, 1993. Principal gravity parameters include observed gravity, Free-air anomalies
  and Bouguer anomalies. The observed gravity values are referenced to the International
  Gravity Standardization Net 1971 (IGSN 71). The gravity anomaly computation uses
  the Geodetic Reference System 1967 (GRS 67) theoretical gravity formula.\",\n\t\"license_title\":
